@testset "1.3.2 Algebraic functions" begin
    @variables a, b, c, d, e, f, g, m, n, p, q, r, s, t, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*u*(a+b*x^3)^p=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*(a+b*x^3)^p=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*sqrt(a+b*x^3))*with*b*c^3 - 4*a*d^3=0=#


    @test_int [1/((2^(2/3) + x)*sqrt(1 + x^3)), x, 4, (2*atan((sqrt(3)*(1 + 2^(1/3)*x))/sqrt(1 + x^3)))/(3*sqrt(3)) + (2*2^(1/3)*sqrt(2 + sqrt(3))*(1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*EllipticF(asin((1 - sqrt(3) + x)/(1 + sqrt(3) + x)), -7 - 4*sqrt(3)))/(3*3^(1/4)*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(1 + x^3))]
    @test_int [1/((2^(2/3) - x)*sqrt(1 - x^3)), x, 4, -((2*atan((sqrt(3)*(1 - 2^(1/3)*x))/sqrt(1 - x^3)))/(3*sqrt(3))) - (2*2^(1/3)*sqrt(2 + sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*EllipticF(asin((1 - sqrt(3) - x)/(1 + sqrt(3) - x)), -7 - 4*sqrt(3)))/(3*3^(1/4)*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(1 - x^3))]
    @test_int [1/((2^(2/3) - x)*sqrt(-1 + x^3)), x, 4, -((2*atanh((sqrt(3)*(1 - 2^(1/3)*x))/sqrt(-1 + x^3)))/(3*sqrt(3))) - (2*2^(1/3)*sqrt(2 - sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 - sqrt(3) - x)^2)*EllipticF(asin((1 + sqrt(3) - x)/(1 - sqrt(3) - x)), -7 + 4*sqrt(3)))/(3*3^(1/4)*sqrt(-((1 - x)/(1 - sqrt(3) - x)^2))*sqrt(-1 + x^3))]
    @test_int [1/((2^(2/3) + x)*sqrt(-1 - x^3)), x, 4, (2*atanh((sqrt(3)*(1 + 2^(1/3)*x))/sqrt(-1 - x^3)))/(3*sqrt(3)) + (2*2^(1/3)*sqrt(2 - sqrt(3))*(1 + x)*sqrt((1 - x + x^2)/(1 - sqrt(3) + x)^2)*EllipticF(asin((1 + sqrt(3) + x)/(1 - sqrt(3) + x)), -7 + 4*sqrt(3)))/(3*3^(1/4)*sqrt(-((1 + x)/(1 - sqrt(3) + x)^2))*sqrt(-1 - x^3))]


    @test_int [1/((2^(2/3)*a^(1/3) + b^(1/3)*x)*sqrt(a + b*x^3)), x, 4, (2*atan((sqrt(3)*a^(1/6)*(a^(1/3) + 2^(1/3)*b^(1/3)*x))/sqrt(a + b*x^3)))/(3*sqrt(3)*sqrt(a)*b^(1/3)) + (2*2^(1/3)*sqrt(2 + sqrt(3))*(a^(1/3) + b^(1/3)*x)*sqrt((a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2)/((1 + sqrt(3))*a^(1/3) + b^(1/3)*x)^2)*EllipticF(asin(((1 - sqrt(3))*a^(1/3) + b^(1/3)*x)/((1 + sqrt(3))*a^(1/3) + b^(1/3)*x)), -7 - 4*sqrt(3)))/(3*3^(1/4)*a^(1/3)*b^(1/3)*sqrt((a^(1/3)*(a^(1/3) + b^(1/3)*x))/((1 + sqrt(3))*a^(1/3) + b^(1/3)*x)^2)*sqrt(a + b*x^3))]
    @test_int [1/((2^(2/3)*a^(1/3) - b^(1/3)*x)*sqrt(a - b*x^3)), x, 4, -((2*atan((sqrt(3)*a^(1/6)*(a^(1/3) - 2^(1/3)*b^(1/3)*x))/sqrt(a - b*x^3)))/(3*sqrt(3)*sqrt(a)*b^(1/3))) - (2*2^(1/3)*sqrt(2 + sqrt(3))*(a^(1/3) - b^(1/3)*x)*sqrt((a^(2/3) + a^(1/3)*b^(1/3)*x + b^(2/3)*x^2)/((1 + sqrt(3))*a^(1/3) - b^(1/3)*x)^2)*EllipticF(asin(((1 - sqrt(3))*a^(1/3) - b^(1/3)*x)/((1 + sqrt(3))*a^(1/3) - b^(1/3)*x)), -7 - 4*sqrt(3)))/(3*3^(1/4)*a^(1/3)*b^(1/3)*sqrt((a^(1/3)*(a^(1/3) - b^(1/3)*x))/((1 + sqrt(3))*a^(1/3) - b^(1/3)*x)^2)*sqrt(a - b*x^3))]
    @test_int [1/((2^(2/3)*a^(1/3) - b^(1/3)*x)*sqrt(-a + b*x^3)), x, 4, -((2*atanh((sqrt(3)*a^(1/6)*(a^(1/3) - 2^(1/3)*b^(1/3)*x))/sqrt(-a + b*x^3)))/(3*sqrt(3)*sqrt(a)*b^(1/3))) - (2*2^(1/3)*sqrt(2 - sqrt(3))*(a^(1/3) - b^(1/3)*x)*sqrt((a^(2/3) + a^(1/3)*b^(1/3)*x + b^(2/3)*x^2)/((1 - sqrt(3))*a^(1/3) - b^(1/3)*x)^2)*EllipticF(asin(((1 + sqrt(3))*a^(1/3) - b^(1/3)*x)/((1 - sqrt(3))*a^(1/3) - b^(1/3)*x)), -7 + 4*sqrt(3)))/(3*3^(1/4)*a^(1/3)*b^(1/3)*sqrt(-((a^(1/3)*(a^(1/3) - b^(1/3)*x))/((1 - sqrt(3))*a^(1/3) - b^(1/3)*x)^2))*sqrt(-a + b*x^3))]
    @test_int [1/((2^(2/3)*a^(1/3) + b^(1/3)*x)*sqrt(-a - b*x^3)), x, 4, (2*atanh((sqrt(3)*a^(1/6)*(a^(1/3) + 2^(1/3)*b^(1/3)*x))/sqrt(-a - b*x^3)))/(3*sqrt(3)*sqrt(a)*b^(1/3)) + (2*2^(1/3)*sqrt(2 - sqrt(3))*(a^(1/3) + b^(1/3)*x)*sqrt((a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2)/((1 - sqrt(3))*a^(1/3) + b^(1/3)*x)^2)*EllipticF(asin(((1 + sqrt(3))*a^(1/3) + b^(1/3)*x)/((1 - sqrt(3))*a^(1/3) + b^(1/3)*x)), -7 + 4*sqrt(3)))/(3*3^(1/4)*a^(1/3)*b^(1/3)*sqrt(-((a^(1/3)*(a^(1/3) + b^(1/3)*x))/((1 - sqrt(3))*a^(1/3) + b^(1/3)*x)^2))*sqrt(-a - b*x^3))]


    @test_int [1/((c + d*x)*sqrt(c^3 + 4*d^3*x^3)), x, 4, (2*atan((sqrt(3)*sqrt(c)*(c + 2*d*x))/sqrt(c^3 + 4*d^3*x^3)))/(3*sqrt(3)*c^(3/2)*d) + (2*2^(1/3)*sqrt(2 + sqrt(3))*(c + 2^(2/3)*d*x)*sqrt((c^2 - 2^(2/3)*c*d*x + 2*2^(1/3)*d^2*x^2)/((1 + sqrt(3))*c + 2^(2/3)*d*x)^2)*EllipticF(asin(((1 - sqrt(3))*c + 2^(2/3)*d*x)/((1 + sqrt(3))*c + 2^(2/3)*d*x)), -7 - 4*sqrt(3)))/(3*3^(1/4)*c*d*sqrt((c*(c + 2^(2/3)*d*x))/((1 + sqrt(3))*c + 2^(2/3)*d*x)^2)*sqrt(c^3 + 4*d^3*x^3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*sqrt(a+b*x^3))*with*b^2*c^6-20*a*b*c^3*d^3-8*a^2*d^6=0=#


    @test_int [1/((1 + sqrt(3) + x)*sqrt(1 + x^3)), x, 4, atan((sqrt(3 + 2*sqrt(3))*(1 + x))/sqrt(1 + x^3))/sqrt(3*(3 + 2*sqrt(3))) + (sqrt(2 + sqrt(3))*(1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*EllipticF(asin((1 - sqrt(3) + x)/(1 + sqrt(3) + x)), -7 - 4*sqrt(3)))/(3^(3/4)*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(1 + x^3))]
    @test_int [1/((1 + sqrt(3) - x)*sqrt(1 - x^3)), x, 4, -(atan((sqrt(3 + 2*sqrt(3))*(1 - x))/sqrt(1 - x^3))/sqrt(3*(3 + 2*sqrt(3)))) - (sqrt(2 + sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*EllipticF(asin((1 - sqrt(3) - x)/(1 + sqrt(3) - x)), -7 - 4*sqrt(3)))/(3^(3/4)*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(1 - x^3))]
    @test_int [1/((1 + sqrt(3) - x)*sqrt(-1 + x^3)), x, 4, -(atanh((sqrt(3 + 2*sqrt(3))*(1 - x))/sqrt(-1 + x^3))/sqrt(3*(3 + 2*sqrt(3)))) - (sqrt(2 - sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 - sqrt(3) - x)^2)*EllipticF(asin((1 + sqrt(3) - x)/(1 - sqrt(3) - x)), -7 + 4*sqrt(3)))/(3^(3/4)*sqrt(-((1 - x)/(1 - sqrt(3) - x)^2))*sqrt(-1 + x^3))]
    @test_int [1/((1 + sqrt(3) + x)*sqrt(-1 - x^3)), x, 4, atanh((sqrt(3 + 2*sqrt(3))*(1 + x))/sqrt(-1 - x^3))/sqrt(3*(3 + 2*sqrt(3))) + (sqrt(2 - sqrt(3))*(1 + x)*sqrt((1 - x + x^2)/(1 - sqrt(3) + x)^2)*EllipticF(asin((1 + sqrt(3) + x)/(1 - sqrt(3) + x)), -7 + 4*sqrt(3)))/(3^(3/4)*sqrt(-((1 + x)/(1 - sqrt(3) + x)^2))*sqrt(-1 - x^3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*sqrt(a+b*x^3))=#


    @test_int [1/((3 + x)*sqrt(1 + x^3)), x, 8, ((1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*atan((sqrt(13/2)*sqrt((1 + x)/(1 + sqrt(3) + x)^2))/sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)))/(sqrt(26)*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(1 + x^3)) + (2*sqrt(26 + 15*sqrt(3))*(1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*EllipticF(asin((1 - sqrt(3) + x)/(1 + sqrt(3) + x)), -7 - 4*sqrt(3)))/(3^(1/4)*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(1 + x^3)) + (4*3^(1/4)*(1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*EllipticPi(97 - 56*sqrt(3), -asin((1 - sqrt(3) + x)/(1 + sqrt(3) + x)), -7 - 4*sqrt(3)))/(sqrt(2 - sqrt(3))*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(1 + x^3))]
    @test_int [1/((3 + x)*sqrt(1 - x^3)), x, 8, -(((1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*atanh((sqrt(7)*sqrt((1 - x)/(1 + sqrt(3) - x)^2))/(2*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2))))/(2*sqrt(7)*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(1 - x^3))) - (2*sqrt(2 + sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*EllipticF(asin((1 - sqrt(3) - x)/(1 + sqrt(3) - x)), -7 - 4*sqrt(3)))/(3^(1/4)*(4 + sqrt(3))*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(1 - x^3)) + (4*3^(1/4)*sqrt(2 + sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*EllipticPi((1/169)*(553 + 304*sqrt(3)), -asin((1 - sqrt(3) - x)/(1 + sqrt(3) - x)), -7 - 4*sqrt(3)))/(13*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(1 - x^3))]
    @test_int [1/((3 + x)*sqrt(-1 + x^3)), x, 8, -(((1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*atanh((sqrt(7)*sqrt((1 - x)/(1 + sqrt(3) - x)^2))/(2*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2))))/(2*sqrt(7)*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(-1 + x^3))) - (2*sqrt(62 - 35*sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 - sqrt(3) - x)^2)*EllipticF(asin((1 + sqrt(3) - x)/(1 - sqrt(3) - x)), -7 + 4*sqrt(3)))/(13*3^(1/4)*sqrt(-((1 - x)/(1 - sqrt(3) - x)^2))*sqrt(-1 + x^3)) + (4*3^(1/4)*sqrt(2 + sqrt(3))*(1 - x)*sqrt((1 + x + x^2)/(1 + sqrt(3) - x)^2)*EllipticPi((1/169)*(553 + 304*sqrt(3)), -asin((1 - sqrt(3) - x)/(1 + sqrt(3) - x)), -7 - 4*sqrt(3)))/(13*sqrt((1 - x)/(1 + sqrt(3) - x)^2)*sqrt(-1 + x^3))]
    @test_int [1/((3 + x)*sqrt(-1 - x^3)), x, 8, ((1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*atan((sqrt(13/2)*sqrt((1 + x)/(1 + sqrt(3) + x)^2))/sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)))/(sqrt(26)*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(-1 - x^3)) + (2*(1 + x)*sqrt((1 - x + x^2)/(1 - sqrt(3) + x)^2)*EllipticF(asin((1 + sqrt(3) + x)/(1 - sqrt(3) + x)), -7 + 4*sqrt(3)))/(3^(1/4)*sqrt(2 - sqrt(3))*sqrt(-((1 + x)/(1 - sqrt(3) + x)^2))*sqrt(-1 - x^3)) + (4*3^(1/4)*(1 + x)*sqrt((1 - x + x^2)/(1 + sqrt(3) + x)^2)*EllipticPi(97 - 56*sqrt(3), -asin((1 - sqrt(3) + x)/(1 + sqrt(3) + x)), -7 - 4*sqrt(3)))/(sqrt(2 - sqrt(3))*sqrt((1 + x)/(1 + sqrt(3) + x)^2)*sqrt(-1 - x^3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*(a+b*x^3)^(1/3))*when*b*c^3+a*d^3=0=#


    @test_int [1/((c + d*x)*(-c^3 + d^3*x^3)^(1/3)), x, 1, (sqrt(3)*atan((1 - (2^(1/3)*(c - d*x))/(-c^3 + d^3*x^3)^(1/3))/sqrt(3)))/(2*2^(1/3)*c*d) + log((c - d*x)*(c + d*x)^2)/(4*2^(1/3)*c*d) - (3*log(d*(c - d*x) + 2^(2/3)*d*(-c^3 + d^3*x^3)^(1/3)))/(4*2^(1/3)*c*d)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*(a+b*x^3)^(1/3))*when*2*b*c^3-a*d^3=0=#


    @test_int [1/((c + d*x)*(2*c^3 + d^3*x^3)^(1/3)), x, 3, atan((1 + (2*d*x)/(2*c^3 + d^3*x^3)^(1/3))/sqrt(3))/(2*sqrt(3)*c*d) - (sqrt(3)*atan((1 + (2*(2*c + d*x))/(2*c^3 + d^3*x^3)^(1/3))/sqrt(3)))/(2*c*d) - log(c + d*x)/(2*c*d) - log((-d)*x + (2*c^3 + d^3*x^3)^(1/3))/(4*c*d) + (3*log(d*(2*c + d*x) - d*(2*c^3 + d^3*x^3)^(1/3)))/(4*c*d)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*1 / ((c+d*x)*(a+b*x^3)^(2/3))*when*2*b*c^3-a*d^3=0=#


    @test_int [1/((c + d*x)*(2*c^3 + d^3*x^3)^(2/3)), x, 1, -(atan((1 + (2*d*x)/(2*c^3 + d^3*x^3)^(1/3))/sqrt(3))/(2*sqrt(3)*c^2*d)) + (sqrt(3)*atan((1 + (2*(2*c + d*x))/(2*c^3 + d^3*x^3)^(1/3))/sqrt(3)))/(2*c^2*d) - log(c + d*x)/(2*c^2*d) - log(d*x - (2*c^3 + d^3*x^3)^(1/3))/(4*c^2*d) + (3*log(d*(2*c + d*x) - d*(2*c^3 + d^3*x^3)^(1/3)))/(4*c^2*d)]


    @test_int [1/((1 + 2^(1/3)*x)*(1 + x^3)^(2/3)), x, 1, -(atan((1 + (2*x)/(1 + x^3)^(1/3))/sqrt(3))/(2^(2/3)*sqrt(3))) + (sqrt(3)*atan((1 + (2*(2^(2/3) + x))/(1 + x^3)^(1/3))/sqrt(3)))/2^(2/3) - log(1 + 2^(1/3)*x)/2^(2/3) - log(x - (1 + x^3)^(1/3))/(2*2^(2/3)) + (3*log(2 + 2^(1/3)*x - 2^(1/3)*(1 + x^3)^(1/3)))/(2*2^(2/3))]
    @test_int [1/((1 - 2^(1/3)*x)*(1 - x^3)^(2/3)), x, 1, -((sqrt(3)*atan((1 + (2*2^(2/3) - 2*x)/(1 - x^3)^(1/3))/sqrt(3)))/2^(2/3)) + atan((1 - (2*x)/(1 - x^3)^(1/3))/sqrt(3))/(2^(2/3)*sqrt(3)) + log(1 - 2^(1/3)*x)/2^(2/3) + log(-x - (1 - x^3)^(1/3))/(2*2^(2/3)) - (3*log(-2 + 2^(1/3)*x + 2^(1/3)*(1 - x^3)^(1/3)))/(2*2^(2/3))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(c+d*x)^m*(a+b*x^3)^(p/3)=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [(c + d*x)^4*(a + b*x^3)^(1/3), x, 11, (3*a*c^2*d^2*(a + b*x^3)^(1/3))/(2*b) + (a*d^4*x^2*(a + b*x^3)^(1/3))/(18*b) + (1/30)*(a + b*x^3)^(1/3)*(15*c^4*x + 40*c^3*d*x^2 + 45*c^2*d^2*x^3 + 24*c*d^3*x^4 + 5*d^4*x^5) - (4*a*c^3*d*atan((1 + (2*b^(1/3)*x)/(a + b*x^3)^(1/3))/sqrt(3)))/(3*sqrt(3)*b^(2/3)) + (a^2*d^4*atan((1 + (2*b^(1/3)*x)/(a + b*x^3)^(1/3))/sqrt(3)))/(9*sqrt(3)*b^(5/3)) + (a*c^4*x*(1 + (b*x^3)/a)^(2/3)*Hypergeometric2F1(1/3, 2/3, 4/3, -((b*x^3)/a)))/(2*(a + b*x^3)^(2/3)) + (a*c*d^3*x^4*(1 + (b*x^3)/a)^(2/3)*Hypergeometric2F1(2/3, 4/3, 7/3, -((b*x^3)/a)))/(5*(a + b*x^3)^(2/3)) - (2*a*c^3*d*log(b^(1/3)*x - (a + b*x^3)^(1/3)))/(3*b^(2/3)) + (a^2*d^4*log(b^(1/3)*x - (a + b*x^3)^(1/3)))/(18*b^(5/3))]
    @test_int [(c + d*x)^3*(a + b*x^3)^(1/3), x, 9, (3*a*c*d^2*(a + b*x^3)^(1/3))/(4*b) + (a*d^3*x*(a + b*x^3)^(1/3))/(10*b) + (1/20)*(a + b*x^3)^(1/3)*(10*c^3*x + 20*c^2*d*x^2 + 15*c*d^2*x^3 + 4*d^3*x^4) - (a*c^2*d*atan((1 + (2*b^(1/3)*x)/(a + b*x^3)^(1/3))/sqrt(3)))/(sqrt(3)*b^(2/3)) + (a*(5*b*c^3 - a*d^3)*x*(1 + (b*x^3)/a)^(2/3)*Hypergeometric2F1(1/3, 2/3, 4/3, -((b*x^3)/a)))/(10*b*(a + b*x^3)^(2/3)) - (a*c^2*d*log(b^(1/3)*x - (a + b*x^3)^(1/3)))/(2*b^(2/3))]
    @test_int [(c + d*x)^2*(a + b*x^3)^(1/3), x, 8, (a*d^2*(a + b*x^3)^(1/3))/(4*b) + (1/12)*(a + b*x^3)^(1/3)*(6*c^2*x + 8*c*d*x^2 + 3*d^2*x^3) - (2*a*c*d*atan((1 + (2*b^(1/3)*x)/(a + b*x^3)^(1/3))/sqrt(3)))/(3*sqrt(3)*b^(2/3)) + (a*c^2*x*(1 + (b*x^3)/a)^(2/3)*Hypergeometric2F1(1/3, 2/3, 4/3, -((b*x^3)/a)))/(2*(a + b*x^3)^(2/3)) - (a*c*d*log(b^(1/3)*x - (a + b*x^3)^(1/3)))/(3*b^(2/3))]
